import IconMenuSidebar from './IconMenu/IconMenuSidebar'

export default class IconMenu extends Component {
    render() {
        return (
            <div>
                {/* begin iconMenu */}
              <a className="btn " data-bs-toggle="offcanvas" href="#offcanvasExample" role="button" aria-controls="offcanvasExample">
              <i className="fas fa-bars a1 mx-t toggle" />
              </a>
              <IconMenuSidebar></IconMenuSidebar>
            </div>
              
        )
    }
}
